    display: flex;
    flex-direction: column;
    justify-content: center;
    min-height: 80vh;
    color: ${({ theme }) => theme.colors.light}
`

export default function HomePageHeader () {
    return (
        <ImageContainer>
        <Logo />
        </ImageContainer>
    )
}
